import { Box, Typography, styled } from "@mui/material";
import { Star } from '@mui/icons-material';
import { useNavigate } from "react-router-dom";

const Banner = styled('img')({
  width: 83,
  height: 120,
  objectFit: 'cover',
  borderRadius: 8,
  marginRight: 10,
});

const Container = styled(Box)`
  display: flex;
  align-items: center;
  background-color: #1c1c1c;
  color: white;
  border-radius: 10px;
  padding: 10px;
  margin: 10px 0;
  transition: transform 0.2s ease-in-out;
  cursor: pointer;
  &:hover {
    transform: scale(1.02);
    background-color: #2a2a2a;
  }
`;

const MoviesList = ({ movies }) => {
  const navigate = useNavigate();
  
  // Enhanced debug logs
  console.log("=== MOVIESLIST DEBUG ===");
  console.log("MoviesList received movies:", movies);
  console.log("Movies type:", typeof movies);
  console.log("Movies is array:", Array.isArray(movies));
  console.log("Movies length:", movies?.length);
  
  if (movies && movies.length > 0) {
    console.log("First movie object:", movies[0]);
    console.log("First movie keys:", Object.keys(movies[0] || {}));
    
    // Check for required properties
    const firstMovie = movies[0];
    console.log("First movie properties check:");
    console.log("- movieid:", firstMovie?.movieid);
    console.log("- title:", firstMovie?.title);
    console.log("- titleimage:", firstMovie?.titleimage);
    console.log("- averagerating:", firstMovie?.averagerating);
    console.log("- releasedate:", firstMovie?.releasedate);
  }
  
  // Handle empty, undefined, or non-array movies
  if (!movies) {
    console.log("Movies is null/undefined");
    return (
      <Box>
        <Typography sx={{ color: 'orange', mt: 2 }}>
          Debug: Movies prop is null/undefined
        </Typography>
      </Box>
    );
  }
  
  if (!Array.isArray(movies)) {
    console.log("Movies is not an array, type:", typeof movies);
    return (
      <Box>
        <Typography sx={{ color: 'orange', mt: 2 }}>
          Debug: Movies prop is not an array (type: {typeof movies})
        </Typography>
        <Typography sx={{ color: '#ccc', mt: 1, fontSize: '0.8rem' }}>
          Received: {JSON.stringify(movies)}
        </Typography>
      </Box>
    );
  }
  
  if (movies.length === 0) {
    console.log("Movies array is empty");
    return (
      <Typography sx={{ color: '#fff', mt: 2 }}>
        No movies to display
      </Typography>
    );
  }

  // console.log("Rendering", movies.length, "movies");

  return (
    <Box>
      {/* Debug info */}
      <Box sx={{ mb: 2, p: 1, bgcolor: '#333', borderRadius: 1 }}>
        <Typography variant="caption" sx={{ color: '#ccc' }}>
          MoviesList Debug: Rendering {movies.length} movie(s)
        </Typography>
      </Box>
      
      {movies.map((movie, index) => {
        // Debug each movie
        console.log(`Rendering movie ${index}:`, movie);
        
        // Handle missing movieid
        const movieKey = movie.movieid || movie.id || index;
        
        return (
          <Container 
            key={movieKey} 
            onClick={() => {
              console.log("Clicked movie:", movie);
              const movieId = movie.movieid || movie.id;
              if (movieId) {
                navigate(`/movie/${movieId}`);
              } else {
                console.error("No movieid found for movie:", movie);
              }
            }}
          >
            <Box sx={{ display: 'flex', alignItems: 'center', width: '100%' }}>
              <Banner 
                src={movie.titleimage ? `/img/${movie.titleimage}` : '/img/placeholder.png'} 
                alt={movie.title || 'Movie'}
                onError={(e) => {
                  console.log(`Image failed to load: /img/${movie.titleimage}`);
                  e.target.src = '/img/placeholder.png';
                }}
              />
              <Box sx={{ flex: 1, display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
                <Typography variant="h6" sx={{ flex: 1 }}>
                  {movie.title || 'Unknown Title'}
                </Typography>
                <Box sx={{ display: 'flex', alignItems: 'center', mx: 2 }}>
                  <Star color="warning" sx={{ mr: 0.5 }} />
                  <Typography>
                    {movie.averagerating ? Number(movie.averagerating).toFixed(1) : 'N/A'}
                  </Typography>
                </Box>
                <Typography>
                  {movie.releasedate ? new Date(movie.releasedate).getFullYear() : 'Unknown'}
                </Typography>
              </Box>
            </Box>
          </Container>
        );
      })}
    </Box>
  );
};

export default MoviesList;
